// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract PrimitiveDataTypes {
    // boolean type 
    bool public boo = true;

    // uinit - non-negative integer
    // uinit8 range is -> 0 to 2^8-1, and uinit16 -> 0 to 2^16-1 
    uint8 public u8 = 1;
    uint public u256 = 456;
    uint public u = 125;

    // int allowed to negative integer
    int8 public i8 = -1;
    int public i16 = 456;
    int public i = -123;

    // dynamic array of bytes
    bytes1 a = 0xb5;
    bytes1 b = 0x5a;

    // default values
    bool public defaultBoolean; // false
    uint public defaultInteger; // 0
    int public defaultInt; // 0
    address public defaultAddress; //0x00000000000000

    // Constructor
    constructor() {
        // Add assert conditions if necessary
        assert(true); // Example assert condition

        // Initialize contract state variables in the constructor if needed
        defaultBoolean = true;
        defaultInteger = 42;
        defaultInt = -42;
        defaultAddress = address(0x123);
    }
}
